import 'bootstrap/dist/css/bootstrap.min.css';
import {Container, Form, Card, Row, Col} from 'react-bootstrap';

const Home = () => {
  return (
    <div
      style={{
        justifyContent: 'center',
        justifyItems: 'center',
        display: 'flex',
      }}
    >
      <Card style={{width: '90%', margin: 20}}>
        <Form>
          <Card.Header as="h5">EXPLORE CANADA</Card.Header>
          <Col sm={3} className="my-1">
            <Form.Label>Name</Form.Label>
            <Form.Control id="inlineFormInputName" placeholder="Jane Doe" />
          </Col>
          <Form.Row className="align-items-center">
            <Form.Group
              controlId="formGroupCheckIn"
              style={{marginLeft: 50, marginTop: 20}}
            >
              <Form.Label style={{fontSize: 14}}>Check In</Form.Label>
              <Form.Control type="date" placeholder="Start Date" />
            </Form.Group>
            <Form.Group
              controlId="formGroupCheckout"
              style={{marginLeft: 50, marginTop: 20}}
            >
              <Form.Label style={{fontSize: 14}}>Check Out</Form.Label>
              <Form.Control type="date" placeholder="End Date" />
            </Form.Group>
          </Form.Row>
        </Form>
      </Card>
    </div>
  );
};
export default Home;
